import { useState } from 'react';
import './clock.css'

let d=new Date;
let Clock=()=>
{
    let [sec,setseconds]=useState(d.getSeconds())
    let updatesecs=()=>
    {
        setseconds(d.getSeconds);
    }

    return(
    <div className="clock">
        <p>{d.getDate()}</p>
        <p>{updatesecs()}</p>
    </div>
);
}
export default Clock
